  false,\n\t\"url\": null,\n\t\"notes\": \"This data set contains geochemical data
  for rock samples collected by U.S. Geological Survey (USGS) personnel and analyzed
  either in the analytical laboratories of the Geologic Discipline of the USGS or
  by contract with commercial analytical laboratories. These data represent analyses
  of rock samples collected in support of various USGS programs. In addition to recent
  data, this data set includes archived geochemical data originally entered into the
  in-house Rock Analysis Storage System (RASS) database (used by the Geologic Discipline
  from the mid-1960's through the late-1980's) and the in-house PLUTO database (used
  by the Geologic Discipline from the mid-1970's through the mid-1990's). All of these
  data are maintained in the Oracle-based National Geochemical Database (NGDB). A
  retrieval from the NGDB was used to generate this data set.\",\n\t\"license_title\":
